- fields: {ordering: 1, parent: 2, region: main, text: "<p>\r\n\tVi \xE4r en studentorkester\
      \ med studenter fr\xE5n Lunds Universitet och Lunds Tekniska H\xF6gskola.\r\n\
      </p>\r\n<p>\r\n\tVi st\xE5r f\xF6r en glad och spexig musikalisk underh\xE5\
      llning, d\xE4r \r\nspelgl\xE4djen - och inte n\xF6dv\xE4ndigtvis den musikaliska\
      \ ekvilibristiken - \r\nkommer i fr\xE4msta rummet. P\xE5 v\xE5r repertoar ryms\
      \ allt fr\xE5n marsch till \r\nschweizisk schlager, s\xE5v\xE4l gammalt som\
      \ nytt.\r\n</p>\r\n<p>\r\n\tVi spelar p\xE5 allt fr\xE5n firmafester via studentjippon\
      \ till invigningar. \r\nN\xE4r du vill engagera oss f\xF6r en spelning eller\
      \ helt enkelt bara ha tag \r\np\xE5 oss n\xE5r du oss l\xE4ttast p\xE5 nedanst\xE5\
      ende adress/telefonnummer.\r\n</p>\r\n<p>\r\n\tVill du h\xF6ra hur vi l\xE5\
      ter s\xE5 finns h\xE4r n\xE5gra smakprov fr\xE5n v\xE5r senaste CD-skiva <a\
      \ href=\"http://www.altekamereren.com/?page=smakprov\">Tunav\xE4gen</a> eller\
      \ titta p\xE5 v\xE5r <a href=\"http://www.youtube.com/user/AlteKamereren\">Youtubekanal</a>.&#160;</p><p>Vi\
      \ har \xE4ven en seniorf\xF6rening \xC4ltere Kamereren som man kan n\xE5 <a\
